var tipuesearch = {"pages":[{"title":"Über uns","text":"Über PyLadies Berlin PyLadies Berlin ist eine der deutschen Ortsgruppen der weltweiten PyLadies Community. Als begeisterte Programmiererinnen entwickeln wir zusammen unsere Python Kentnisse und möchten dich einladen mit dabei zu sein! Die globale PyLadies Mentorship Gemeinschaft hat es sich zum Auftrag gemacht Frauen dabei zu unterstützen als aktive Mitglieder die Python-Welt zu gestalten and führende Köpfe in der Python Open-Source Community zu werden. Unsere Mission ist es, zu unterstützen, auszubilden and die Python community diverser, bunter, kreativer zu machen. Durch gemeinschafftliche Initiative, Weiterbildung, Konferenzen, Events and persönliche Treffen. PyLadies möchte ein freundliches Unterstützungsnetzwerk für Frauen und eine Brücke zur größeren Python-Welt bieten. Wir möchten das gerade Frauen sich in der Programmier-Welt willkommen fühlen und sorgen deswegen dafür, dass unsere Events eine einladende und sicher Umgebung für den Einstieg und die !TRANSLATION WIP! Wir wollen in einer Welt leben, in der weibliche Perspektiven in der Technik selbstverständlich sind. (from haecksen) As a group of women developers who love the Python programming language. We write code by day or night. Some of us hack on Python projects on the side, while others work full-time on Python development. But it doesn't matter. We all just like writing Python code, and that's what brings us together. Are you an experienced female Python developer? Or are you new and need help getting into Python development? Schau vorbei und schließe dich uns an! So findest du zu uns: Besuche unsere Meetup Events als Gast oder Mentorin. Tritt unserem Slack Workspace bei. Stelle Frage und teile cooles Python Wissen!","tags":"de","url":"https://berlin.pyladies.com/de/pages/about.html","loc":"https://berlin.pyladies.com/de/pages/about.html"},{"title":"Jobs","text":"Bist du auf der Suche nach einem Python Job? Schau in unseren Slack in #jobs-europe Kanal und #feed-jobs (auf diesem Kanal findest du vor allem Jobs in den USA). Hat deine Firma tolle Python Jobs die du teilen möchtest? Veröffentliche den Job direkt in unserem Slack Kanal #job-europe. Für Job-Postings füllst du am besten dieses Formular aus, die Anzeige wird dann automatisch in unserem #feed-jobs Slack Kanal veröffentlicht. Das Formular ist ausschließlich für Stellenanzeigen außerhalb Europas gedacht.","tags":"de","url":"https://berlin.pyladies.com/de/pages/jobs.html","loc":"https://berlin.pyladies.com/de/pages/jobs.html"},{"title":"Meetups","text":"Meetups We have monthly meetups with talks and workshop on various python related and development in general and data topics. You can find and join upcoming events on our Meetup group . We do have varying levels in different meetups from novice to expert in specific topics. We always try to include a \"Non-coding superpower\" 10 mins talk as tech life and life is much more than coding! Speak in our meetup We love to hear what you have to share with the community, from beginners topic to a project you worked on or a hands on session or a non-coding superpower! Reach out to us via email or slack.","tags":"de","url":"https://berlin.pyladies.com/de/pages/meetups.html","loc":"https://berlin.pyladies.com/de/pages/meetups.html"},{"title":"Resources","text":"Resources https://github.com/PyLadiesBerlin/resources#readme","tags":"de","url":"https://berlin.pyladies.com/de/pages/resources.html","loc":"https://berlin.pyladies.com/de/pages/resources.html"}]};